Blockly.Msg.TOUR1_DESCRIPTION01 = "Шчыра запрашаем,<br> націсніце на наступнае і пачніце тур па Open Roberta Lab.<br> Я пакажу Вам, як запраграмаваць робата з NEPO.>br> Вы можаце скончыць гэты тур у любы час. Для гэтага націсніце на Х у правым верхнім куце.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "Меню ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Тут Вы можаце знайсці ўсё, што неабходна для праграмавання робата! <br> <SPAN class='typcn typcn-дакумент-тэкст'> </ SPAN>Захаванне і заладоўванне праграм<br> <SPAN class='typcn typcn-Roberta'> </ SPAN> Падключэнне робата да Open Roberta Lab <br> <SPAN class='typcn typcn-lightbulb'> </ SPAN> Дапамога па ўсіх відах праблемаў br> <SPAN class='typcn typcn user'> </ SPAN> Усё аб уліковых запісах карыстальнікаў, напрыклад, уваход альбо выхад з сістэмы";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Націсніце тут, каб пераключыцца назад у асяродак праграмавання!";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Вы можаце змяніць канфігурацыю робата пазней,<br> калі Вы сканструявалі іншага робата.<br> Калі ў вас няма робата і Вы хочаце праверыць Вашу праграму ў сімуляцыі,<br> будзе застасавана гэта канфігурацыя.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "Клікніце тут, каб пераключыцца назад у вобласць праграмавання!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Панэль інструментаў.<br> Тут Вы можаце знайсці ўсе праграмныя блокі.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Калі Вы адчуваеце сябе ўпэўнена, то можаце пераключыцца на экспертную панэль інструментаў.<br> Там Вы зможаце знайсці большую колькасць блокаў для праграмавання робата.<br><span class='typcn typcn-media-stop-outline\"></span> рэжым пачаткоўца<br><span class=\"typcn typcn-star-outline\"></span> рэжым эксперта";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Кожная праграма пачынаецца з блока запуску праграмы.<br>";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Тут Вы знойдзеце некаторыя клавішы хуткага доступу<br> Злева направа: <br> <SPAN class='typcn typcn-медиа-игра'> </ SPAN>Націсніце тут, каб выканаць праграму на рэальным робаце <br> <SPAN class='typcn typcn-media-play-outline'> </ SPAN> Націсніце тут, каб запусціць робата ў сімуляцыі <br> <SPAN class='typcn typcn-cloud-storage'> </ SPAN> Захаваць Вашу праграму, але спярша Вам трэба ўвайсці ў сістэму <br> <SPAN class='typcn typcn-zoom'> </ SPAN> Націсніце тут, калі Вы хочаце змяніць маштаб выяваў блокаў <br> <SPAN class='typcn typcn-acrhive'> </ SPAN>Сметніца! Проста перамясціце блокі ў сметніцу, каб выдаліць іх <br> & NBSP;. & NBSP; & NBSP; & NBSP; & NBSP; & NBSP; Увага: як толькі блокі будуць выдалены, Вы не змажаце аднавіць іх!<br>";
